import { Button, Paper, Typography } from "@mui/material";
import { Box, Stack } from "@mui/system";
import React from "react";

function HomePage() {
  return (
    <Box textAlign="center">
      <Typography p={2} fontSize={50}>
        Quiz App
      </Typography>
      <Paper variant="outlined" sx={{ mx: "auto", width: "50%" }}>
        <Stack direction="row">
          <Button sx={{ flexGrow: 1 }}>Register</Button>
          <Button>Login</Button>
        </Stack>
      </Paper>
    </Box>
  );
}

export default HomePage;
